//就只能做逆透视变换了
//规定
//inv[0] - 存储x坐标
//inv[1] - 存储y坐标
void Camera_GetInverse(uint8 x, uint8 y, uint8 inv[2]) {
    uint8 inv_x = (uint8) ((inv_H[0][0] * x
                        + inv_H[0][1] * y + inv_H[0][2])
                        / (inv_H[2][0] * x + inv_H[2][1] * y
                        + inv_H[2][2]));
    uint8 inv_y = (uint8) ((inv_H[1][0] * x
                          + inv_H[1][1] * y + inv_H[1][2])
                         / (inv_H[2][0] * x + inv_H[2][1] * y
                        + inv_H[2][2]));
    if (inv_x >= 0 && inv_y >= 0 && inv_x < IMAGE_WIDTH && inv_y < IMAGE_HEIGHT) {
        inv[0] = inv_x;
        inv[1] = inv_y;
    }
    else {
        inv[0] = 0;
        inv[1] = 0;
    }
}

